import React from 'react'
import './App.css';

import { BrowserRouter as Router, useRoutes } from "react-router-dom";
import { indexRouter } from './routers/indexRouter';
function AppRouter() {
  const routes = useRoutes([indexRouter]);
  return routes;
}
function App() {
  return (
      <Router>
        <AppRouter />
      </Router>
  );
}

export default App;
